(477, 'The default name', 'The default name of the Zenchat bot is Kloe  but you have the flexibility to choose any name you prefer  What sets Kloe apart is its incredible ability to learn autonomously  even from external sources such as websites  By providing an URL  Kloe can extract relevant information and enhance its knowledge base ', 'sparacinoriccardo@gmail.com', '2023-12-19 13:12:44'),
