(504, 'Il', 'Il gratuito patrocinio ? un istituto giuridico introdotto dal testo Unico sulle Spese di Giustizia (DPR 115/2002) che consente a chi ? privo di un reddito minimo  di essere difeso gratuitamente, e quindi a farsi assistere e rappresentare in giudizio da un legale senza dover pagare le spese di difesa e le altre spese processuali poich? queste vengono pagate dallo stato. Il Patrocinio a spese dello Stato ? consentito per la sola difesa processuale e non ? autorizzato in Italia per l assistenza extragiudiziale (ad esempio, per consulenza ed attivit? del legale prima del giudizio).', 'enricocrucilla@libero.it', '2024-01-01 17:37:55'),
(505, 'L avv.', 'L avv. Enrico Crucill? ? disponibile a fornire assistenza con il gratuito patrocinio a tutti coloro che ne abbiano i requisiti sia in ambito civile (anche per i procedimenti di separazione e divorzio consensuale o giudiziale) che penale. La disponibilit? riguarda i Tribunali di Catania, Siracusa e provincia.Lo Studio si trova in Catania Via Ferrante Aporti 16 ed i recapiti sono i seguenti:Tel/Fax 095.8841283 - Cell. 3490653044Sito web: www.avvocatocrucilla.it', 'enricocrucilla@libero.it', '2024-01-01 17:38:16'),
(506, 'L Avv.', 'L Avv. Emanuela Lagan? ? disponibile all assistenza con il patrocinio a spese dello Stato in sede penale .L assistenza viene offerta sia all indagato/imputato che alla parte offesa che intenda costituirsi parte civile nel processo penale.\nLo studio si trova in Catania Via Ferrante Aporti 16Tel/Fax 095.8841283 - Cell. 3929675206Sito web: www.studiolagana.altervista.org', 'enricocrucilla@libero.it', '2024-01-01 17:38:36'),
(507, 'In', 'In tutti i procedimenti (escluso il penale) il gratuito patrocinio potr? essere riconosciuto purch? non si tratti di questioni manifestamente infondate. \nNel processo penale potr? beneficiare l  indagato, imputato condannato, persona offesa da reato, danneggiato che intenda costituirsi parte civile, responsabile civile o civilmente obbligato per la pena pecuniaria.L ammissione ? valida, ex art. 75 del D.p.r. n. 115/2002, in ogni grado e fase del processo compresa la Cassazione e per tutte le procedure incidentali connesse al procedimento principale.\nL istituto, in Italia, ? ammissibile solo per l attivit? giudiziale e non anche per quella stragiudiziale.\nPer quanto concerne i limiti di reddito pu? essere ammesso al gratuito patrocinio chi e  titolare di un reddito annuo imponibile ai fini dell imposta personale sul reddito, non superiore ad Euro 11.746,68 risultante dall ultima dichiarazione (importo aggiornato 2021). Se l interessato convive con il coniuge o con altri familiari, il reddito ? costituito dalla somma dei redditi conseguiti nello stesso periodo da ogni componente della famiglia compreso l istanteIl gratuito patrocinio ? un istituto giuridico introdotto dal testo Unico sulle Spese di Giustizia (DPR 115/2002) che consente a chi ? privo di un reddito minimo  di essere difeso gratuitamente, e quindi a farsi assistere e rappresentare in giudizio da un legale senza dover pagare le spese di difesa e le altre spese processuali poich? queste vengono pagate dallo stato. Il Patrocinio a spese dello Stato ? consentito per la sola difesa processuale e non ? autorizzato in Italia per l assistenza extragiudiziale (ad esempio, per consulenza ed attivit? del legale prima del giudizio).Il DPR dispone, per tutti coloro che abbiano un reddito inferiore ad euro 11.746,68 la possibilit? di accedere al beneficio della difesa processuale gratuita in ambito civile e penale.\nPer usufruire del gratuito patrocinio in sede civile occorre presentare una domanda presso la segreteria del Consiglio dell Ordine degli Avvocati di Catania. La domanda pu? essere presentata personalmente o per il tramite del proprio avvocato, scelto tra coloro che risultano abilitati al gratuito patrocinio presso il Consiglio dell Ordine degli Avvocati di Catania. L istanza da presentare deve essere sottoscritta dall interessato a pena di inammissibilit? e la sottoscrizione ? autenticata dal difensore. Unitamente all istanza devono essere allegati i seguenti documenti:stato di famiglia e anagrafico;copia della carta d identit? del richiedente;copia dei codici fiscali dei componenti il nucleo familiare;autocertificazione che attesti la mancanza di reddito o lo stato di disoccupazione;nel caso di familiari conviventi: documentazione attestante il reddito anche a mezzo di autocertificazione;La domanda, (il modulo si trova presso le segreteria del Consiglio dell Ordine degli avvocati di Catania o ve lo fornir? il vostro legale) deve contenere: la richiesta di ammissione al patrocinio; le generalit? del richiedente e dei membri della sua famiglia; le ragioni di fatto e di diritto idonee a valutare la fondatezza della pretesa; le prove utili; l impegno a comunicare, fino a che il processo non sia definito, le variazioni rilevanti dei limiti di reddito, verificatesi nell anno precedente, entro trenta giorni dalla scadenza del termine di un anno, dalla data di presentazione dell istanza o della eventuale precedente comunicazione di variazione. L istanza ? scaricabile dal sito del Consiglio dell Ordine degli Avvocati di Catania ed ? consigliabile compilarla unitamente al proprio avvocato, che provveder? ad autenticare la firma del proprio cliente dopo che lo stesso abbia provveduto alla compilazione.\nIl Consiglio dell Ordine dopo il deposito della domanda valuta la fondatezza delle pretese da far valere e se ricorrono le condizioni per l ammissibilit? ed entro 10 giorni decide se accogliere la domanda o rigettarla o dichiararla inammissibile. Trasmette copia del provvedimento all interessato, al giudice competente e all Ufficio delle Entrate, per la verifica dei redditi dichiarati. L ammissione vale per tutti gli stati e gradi del giudizio.Solo nell ambito penale il limite di reddito ? elevato di euro 1.032,91 per ognuno dei familiari conviventi. \nLa domanda di ammissione in ambito penale si presenta presso l ufficio del magistrato davanti al quale pende il processo e quindi: al GIP se il procedimento ? nella fase delle indagini preliminari, al giudice che procede, se il procedimento ? nella fase successiva, al giudice che ha emesso il provvedimento impugnato, se il procedimento ? davanti alla Corte di Cassazione. Presso il Tribunale di Catania ? stato istituito un ufficio unico in cui ? possibile depositare le istanze sia in forma cartacea che con deposito telematico.Come si presenta la domanda La domanda deve essere presentata personalmente dall interessato con allegata fotocopia di un documento di identit? valido, oppure pu? essere presentata dal difensore che dovr? autenticare la firma di chi sottoscrive la domanda. Potr? anche essere inviata a mezzo raccomandata a.r. con allegata fotocopia di un documento di identit? valido del richiedente. La domanda, sottoscritta dall interessato, va presentata in carta semplice e deve indicare: la richiesta di ammissione al patrocinio le generalit? anagrafiche e codice fiscale del richiedente e dei componenti il suo nucleo familiare l attestazione dei redditi percepiti l anno precedente alla domanda (autocertificazione) l impegno a comunicare le eventuali variazioni di reddito rilevanti ai fini dell ammissione al beneficio. Se il richiedente ? detenuto la domanda pu? essere presentata al direttore dell istituto carcerario che ne cura la trasmissione al magistrato che procede. Se il richiedente ? agli arresti domiciliari o sottoposto a misura di sicurezza la domanda pu? essere presentata ad un ufficiale di polizia giudiziaria che ne cura la trasmissione al magistrato che procede. Se il richiedente ? straniero (extracomunitario) la domanda deve essere accompagnata da una certificazione (per i redditi prodotti all estero) dell autorit? consolare competente che attesti la verit? di quanto dichiarato nella domanda. In caso di impossibilit?, la certificazione pu? essere sostituita da autocertificazione. Se il richiedente ? straniero ed ? detenuto, internato per esecuzione di misura di sicurezza, in stato di arresto o di detenzione domiciliare, la certificazione consolare pu? essere prodotta entro venti giorni dalla data di presentazione dell istanza, dal difensore o da un componente della famiglia dell interessato (oppure pu? essere sostituita da autocertificazione).', 'enricocrucilla@libero.it', '2024-01-01 17:42:53'),
(587, 'COPYRIGHT   ALL', '       COPYRIGHT  C  2023   ALL RIGHTS RESERVED  MADE BY REATTIVA     ', 'info@noleggiatutto.shop', '2024-01-31 18:01:55'),
(588, 'Utilizzare i nostri servizi è semplicissimo. Ecco come funziona.', 'Utilizzare i nostri servizi è semplicissimo. Ecco come funziona.\r\nL APPROCCIO “OPERATIVO” CHE FA LA DIFFERENZA\r\n\r\n1\r\nPuoi indicarci tu stesso la marca e il modello dei beni strumentali di cui hai bisogno per completare il tuo business. Siamo completamente indipendenti dalle aziende produttrici. Di conseguenza, nella scelta dei tuoi beni in locazione, non sei vincolato a determinati marchi o produttori.\r\n2\r\nDopo avere analizzato la tua richiesta di locazione operativa, passeremo al vaglio l’elenco dei fornitori. Ti proporremo i migliori prodotti al canone fisso che desideri e prepareremo sinergicamente, in base alle tue esigenze, il contratto di locazione ideale per la tua azienda.\r\n3\r\nA questo punto, una volta ottenuta l’autorizzazione a procedere con il contratto, non ti resta che attendere la consegna dei tuoi nuovi beni direttamente in azienda.', 'info@noleggiatutto.shop', '2024-01-31 18:01:55'),
